/*==================================================
EditCampusView.js

This file defines the UI for editing campus details.
It allows users to edit the campus name, address, description, and image URL.
================================================== */

import React, { useState, useEffect } from "react";
import { useParams, useHistory } from "react-router-dom";

const EditCampusView = ({ fetchCampus, updateCampus, campus }) => {
  const { id } = useParams(); // Get campus ID from the route
  const history = useHistory();
  const [formData, setFormData] = useState({
    name: "",
    address: "",
    description: "",
    imageUrl: "",
  });

  // Fetch the campus data when the component mounts
  useEffect(() => {
    const fetchData = async () => {
      await fetchCampus(id);
    };
    fetchData();
  }, [id, fetchCampus]);

  // Update form data when the campus data is fetched
  useEffect(() => {
    if (campus) {
      setFormData({
        name: campus.name || "",
        address: campus.address || "",
        description: campus.description || "",
        imageUrl: campus.imageUrl || "",
      });
    }
  }, [campus]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    await updateCampus(id, formData); // Call the updateCampus function
    history.push(`/campus/${id}`); // Navigate back to the Campus View
  };

  const handleCancel = () => {
    history.push(`/campus/${id}`); // Navigate back to the Campus page without saving
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Edit Campus</h1>
      <form style={styles.form} onSubmit={handleSubmit}>
        <label style={styles.label}>
          Name:
          <input
            style={styles.input}
            type="text"
            name="name"
            value={formData.name}
            onChange={handleChange}
            required
          />
        </label>
        <label style={styles.label}>
          Address:
          <input
            style={styles.input}
            type="text"
            name="address"
            value={formData.address}
            onChange={handleChange}
            required
          />
        </label>
        <label style={styles.label}>
          Description:
          <textarea
            style={styles.textarea}
            name="description"
            value={formData.description}
            onChange={handleChange}
          />
        </label>
        <label style={styles.label}>
          Image URL:
          <input
            style={styles.input}
            type="text"
            name="imageUrl"
            value={formData.imageUrl}
            onChange={handleChange}
          />
        </label>
        <div style={styles.buttonContainer}>
          <button style={styles.submitButton} type="submit">
            Save Changes
          </button>
          <button
            style={styles.cancelButton}
            type="button"
            onClick={handleCancel}
          >
            Cancel
          </button>
        </div>
      </form>
    </div>
  );
};

// Inline styles
const styles = {
  container: {
    maxWidth: "600px",
    margin: "50px auto",
    padding: "20px",
    backgroundColor: "#f8f9fa",
    borderRadius: "12px",
    boxShadow: "0px 4px 8px rgba(0, 0, 0, 0.1)",
  },
  title: {
    textAlign: "center",
    fontFamily: "'Merriweather', serif",
    fontWeight: "bold",
    fontSize: "32px",
    color: "#333",
    marginBottom: "20px",
  },
  form: {
    display: "flex",
    flexDirection: "column",
  },
  label: {
    marginBottom: "10px",
    fontSize: "16px",
    fontWeight: "bold",
    color: "#555",
  },
  input: {
    padding: "8px",
    marginBottom: "15px",
    border: "1px solid #ddd",
    borderRadius: "6px",
    fontSize: "16px",
  },
  textarea: {
    padding: "8px",
    marginBottom: "15px",
    border: "1px solid #ddd",
    borderRadius: "6px",
    fontSize: "16px",
    minHeight: "100px",
  },
  buttonContainer: {
    display: "flex",
    justifyContent: "space-between",
  },
  submitButton: {
    padding: "10px 20px",
    backgroundColor: "#28a745",
    color: "#fff",
    border: "none",
    borderRadius: "6px",
    cursor: "pointer",
    fontWeight: "bold",
  },
  cancelButton: {
    padding: "10px 20px",
    backgroundColor: "#dc3545",
    color: "#fff",
    border: "none",
    borderRadius: "6px",
    cursor: "pointer",
    fontWeight: "bold",
  },
};

export default EditCampusView;
